import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { RootState } from '../../store/store'
import { useMutation } from 'react-query'
import { userApi } from '../../service/userApi'
import { addressChanOn, emailChanOn, nameChanOn, phoneChanOn } from '../../store/userSlice'

export default function Forma() {

  const OrderPrice = useSelector((state:RootState) => state.order.OrderPrice)



  // const postTodo = async (text: Todo['text']): Promise<Todo> => {
  //   const response = await fetch('api/tasks', {
  //     method: 'POST',
  //     headers: {
  //       'Content-Type': 'application/json',
  //     },
  //     body: JSON.stringify({ text }),
  //   });
  //   if (!response.ok) {
  //     throw new ResponseError('Failed to insert new todo', response);
  //   }
  //   return await response.json();
  // };



  // const { mutate: addUser, isLoading, error } = useMutation(User, {
  //   onSuccess: () => {
  //     // Success actions
  //   },
  //   onError: (error) => {
  //     // Error actions
  //   },
  // });

  const username = useSelector((state:RootState) => state.user.username)
  const email = useSelector((state:RootState) => state.user.email)
  const phone = useSelector((state:RootState) => state.user.phone)
  const address = useSelector((state:RootState) => state.user.address)
  const dispatch = useDispatch()


  const NameChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    dispatch(nameChanOn(event.target.value));
     console.log(event.target.value);
   };

  const EmailChange = (event: React.ChangeEvent<HTMLInputElement>) => {
   dispatch(emailChanOn(event.target.value));
    console.log(event.target.value);
  };

  const PhoneChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    dispatch(phoneChanOn(event.target.value));
     console.log(event.target.value);
   };


   const AddressChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    dispatch(addressChanOn(event.target.value));
     console.log(event.target.value);
   };



  return (


    <div className="border-b border-gray-900/10 pb-12 w-96 ml-12 mt-12">
    <h2 className="text-base font-semibold leading-7 text-gray-900">Personal Information</h2>
    <p className="mt-1 text-sm leading-6 text-gray-600">Use a permanent address where you can receive mail.</p>

    <div className="mt-10 grid grid-cols-1 gap-x-6 gap-y-8 sm:grid-cols-6">
      <div className="sm:col-span-3">
        <label htmlFor="first-name" className="block text-sm font-medium leading-6 text-gray-900">
          First name
        </label>
        <div className="mt-2">
          <input
            value={username}
            onChange={(event) => NameChange(event) }
            type="text"
            name="first-name"
            id="first-name"
            autoComplete="given-name"
            className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
          />
        </div>
      </div>



      <div className="sm:col-span-4">
        <label htmlFor="email" className="block text-sm font-medium leading-6 text-gray-900">
         Email:
        </label>
        <div className="mt-2">
          <input
            value={email}
            onChange={(event) => EmailChange(event) }
            id="email"
            name="email"
            type="email"
            autoComplete="email"
            className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
          />
        </div>
      </div>

      <div className="sm:col-span-4">
        <label htmlFor="email" className="block text-sm font-medium leading-6 text-gray-900">
          Phone
        </label>
        <div className="mt-2">
          <input
           value={phone}
           onChange={(event) => PhoneChange(event) }
            id="phone"
            name="phone"
            type="phone"
            autoComplete="phone"
            className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
          />
        </div>
      </div>


      <div className="sm:col-span-4">
        <label htmlFor="email" className="block text-sm font-medium leading-6 text-gray-900">
        Address
        </label>
        <div className="mt-2">
          <input
            value={phone}
            onChange={(event) => AdressChange(event)}
            id="address"
            name="address"
            type="address"
            autoComplete="address"
            className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
          />
        </div>
      </div>

      </div>
                         <h1>Price:{OrderPrice}</h1>
      </div>

  )
}
